      <text id="208" justification="0" size="4" underlined="false">
        <text>Server just opens a socket for listening
and creates a ClientHandler thread for each
connection. ClientHandler just repeatedly calls
.readObject on the socket and then checks
whether it&apos;s a CommandMessage or GetMessage
then calls message.execute, which returns a Reply
that is then sent back with .writeObject</text>

    <NoteNode id="244">
      <children id="245"/>
      <location class="Point2D.Double" id="246" x="120.0" y="830.0"/>
      <id id="247" value="f706e866-7723-4728-a970-e7fe0752cda3"/>
      <revision>1</revision>
      <backgroundColor reference="9"/>
      <borderColor reference="10"/>
      <textColor reference="10"/>
      <text id="248" justification="0" size="4" underlined="false">
        <text>Redis (REmote DIctionary Server)
uh i mean ReDuber
(REmote [not really] DUctionary serBER)
(let&apos;s say duber isn&apos;t the best at spelling)
is a thread safe (internally single threaded)
key-value data structure datastore.
supported types are long, string, Set&lt;Long&gt;,
and SortedArray&lt;Long&gt;.
the dictionary is entirely flat, there is only a top
level set of keys - nesting data can be achieved
by writing to string keys such as
&quot;users.123456789.friends&quot; or
&quot;users.123456789.username&quot; where the number
is the user id.
see ReDuber.seq.violet.html for an explanation of
the implementation
reduber package minimal tour:
- Skim through ReDuber
- Look at ReDuberStore
- Look at OperationData, Operation, and skim a few
of the subclasses/concrete subclasses
- Look at ReDuberPubSub</text>
      </text>
      <color reference="209"/>
    </NoteNode>
    <NoteNode id="249">
      <children id="250"/>
      <location class="Point2D.Double" id="251" x="1090.0" y="1400.0"/>
      <id id="252" value="fe89ea28-1fff-49ec-a5bf-7d8fd818e4e1"/>
      <revision>1</revision>
      <backgroundColor reference="9"/>
      <borderColor reference="10"/>
      <textColor reference="10"/>
      <text id="253" justification="0" size="4" underlined="false">
        <text>ReDuber PubSub (publish/subscribe) is
a pub/sub broker that delivers messages
published to arbitrary sets of users.
When a user logs in to the server, they open
two sockets, one of which will be used with
messages.* type data, one will be used for pubsub
messages. The pubsub socket performs PubSubLogin,
which registers the ObjectOutputStream of that socket
to a weak reference within ReDuberStore (when the
socket is no longer in scope in the ClientHandler, the
weak reference will not prevent garbage collection of
the streams).
ReDuberStore maintains a mapping of userIds to weak
sets of ObjectOutputStreams, which will be a collection of
logged in users.
publish operations take a Serializable message,
and a String key argument. the corresponding value
to the key will be retrieved from the store (which is either a
Set (PublishMany) or a long (PublishSingle)), and a
PublishJob is created for each userId in that value
that is logged in (has ObjectStreams in the map).
There is also a PublishDirect operation which is
functionally equivalent to PublishSingle but instead of
a db value referencing the user, the caller specifies the user.</text>
      </text>
      <color reference="209"/>
    </NoteNode>
